===Noun===
[[Image:Niigata NCM Peasant Rice Farmers House.jpg|thumb|right|350 px|The '''house''' of a Japanese rice farmer.]]
{{en-noun|houses}}

# Human habitation
## {{senseid|en|abode}} A structure serving as an [[abode]] of human beings. {{defdate|from 9th c.}}
##* {{quote-book|year=1913|author={{w|Joseph C. Lincoln}}|chapter=1
|title=[http://openlibrary.org/works/OL5535161W Mr. Pratt's Patients]|chapter=1
|passage=Pretty soon I struck into a sort of path&nbsp;{{...}}. It twisted and turned,{{...}}and opened out into a big clear space like a lawn. And, back of the lawn, was a big, old-fashioned '''house''', with piazzas stretching in front of it, and all blazing with lights. 'Twas the '''house''' I'd seen the roof of from the beach.}}
##: {{usex|This is my '''house''' and my family's ancestral home.|lang=en}}
## An [[animal]]'s [[shelter]] or [[den]], or the shell of an animal such as a [[snail]], used for protection. {{defdate|from 10th c.}}
## A [[building]] used by people for something other than a main [[residence]] (typically with qualifying word). {{defdate|from 10th c.}}
##: {{usex|The former carriage ''house'' had been made over into a guest '''house'''.|lang=en}}
## A [[public house]], an [[inn]], or the management of such. {{defdate|from 10th c.}}
##: ''the '''House''' of the Rising Sun''
##: ''One more, sir, then I'll have to stop serving you – rules of the '''house''', I'm afraid.''
## {{senseid|en|the theatre itself}} A place of public entertainment, especially (without qualifying word) a [[theatre]]; also the audience for a live theatrical or similar performance. {{defdate|from 10th c.}}
##* {{quote-book|year=1905|author=[[w:Emma Orczy|Baroness Emmuska Orczy]]
|title=[[w:The Case of Miss Elliott|The Affair at the Novelty Theatre]]
|chapter=2|url=http://openlibrary.org/works/OL8479084W
|passage=Miss Phyllis Morgan, as the hapless heroine dressed in the shabbiest of clothes, appears in the midst of a gay and giddy throng; she apostrophises all and sundry there, including the villain, and has a magnificent scene which always brings down the '''house''', and nightly adds to her histrionic laurels.}}
##: {{usex|After her swan-song, there wasn't a dry eye in the '''house'''.|lang=en}}
## A [[brothel]]. {{defdate|from 10th c.}}
## {{context|business|lang=en}} A place of [[business]]; a company or organisation. {{defdate|from 10th c.}}
## {{context|politics|lang=en}} The building where a deliberative assembly meets; hence, the assembly itself, forming a component of a (national or state) [[legislature]]. {{defdate|from 10th c.}}
##: ''The petition was so ridiculous that the '''house''' rejected it after minimal debate.''
## A printer's or [[publishing]] company. {{defdate|from 16th c.}}
##: {{usex|A small publishing '''house''' would have a contract with an independent fulfillment '''house'''.|lang=en}}
## A place of [[gambling]]; a [[casino]]. {{defdate|from 18th c.}}
## A [[grouping]] of [[schoolchildren]] for the purposes of competition in sports and other activities. {{defdate|from 19th c.}}
##: {{usex|I was a member of Spenser '''house''' when I was at school.|lang=en}}
# Extended senses
## {{context|literary|lang=en}} Somewhere something metaphorically [[reside]]s; a place of [[rest]] or [[repose]]. {{defdate|from 9th c.}}
##* '''1598''', {{w|Ben Jonson}}, ''Every Man in his Humor'':
##*: Like a pestilence, it doth infect / The '''houses''' of the brain.
##* '''1815''', {{w|Walter Scott}}, ''The Lord of the Isles'':
##*: Such hate was his, when his last breath / Renounced the peaceful '''house''' of death {{...}}.
## The people who live in the same house; a [[household]]. {{defdate|from 9th c.}}
##* Bible, Acts x. 2
##*: one that feared God with all his '''house'''
## A dynasty, a familial descendance; a family with its [[ancestor]]s and [[descendant]]s, especially a royal or noble one. {{defdate|from 10th c.}}
##: {{usex|The current Queen is from the '''House''' of Windsor.|lang=en}}
## {{context|astrology|lang=en}} One of the twelve divisions of an astrological chart. {{defdate|from 14th c.}}
##* '''1971''', {{w|Keith Thomas (historian)|Keith Thomas}}, ''Religion and the Decline of Magic'', Folio Society 2012, page 313:
##*: Since there was a limited number of planets, '''houses''' and signs of the zodiac, the astrologers tended to reduce human potentialities to a set of fixed types and to postulate only a limited number of possible variations.
## {{context|chess|now|_|rare|lang=en}} A [[square]] on a [[chessboard]], regarded as the proper place of a [[piece]]. {{defdate|from 16th c.}}
## {{context|curling|lang=en}} The four [[concentric]] circles where points are scored on the [[ice]]. {{defdate|from 19th c.}}
## [[lotto|Lotto]]; [[bingo]]. {{defdate|from 20th c.}}
## {{senseid|en|genre of music}} [[house music|House music]].
## {{context|uncountable|US|lang=en}} An aggregate of characteristics of a house.
##* {{quote-news|title=Goin' South Affordable is trendy in these suburbs|work=Chicago Tribune|date=Feb 24|year=1990|passage=In comparison with the western suburbs, we felt we could get a lot more '''house''' for the money.}}
##* {{quote-news|title=DOWNSIZERS LIVE IT UP - BABY BOOMERS WANT SMALLER HOMES WITH LOTS OF...|work=Pittsburgh Post-Gazette|date=Jan 16|year=2005|passage=There's just a huge number of people who are close to retirement and feel they have too much '''house''' on too much property.}}
##* {{quote-news|title=When Will the Slump End?|work=Newsweek|date=Nov 6|year=2007|passage=Those homeowners who bought too much '''house''', or borrowed against inflated values are now going to be liable for their own poor decisions}}
## {{rft-sense|proper noun?|lang=en}} {{context|uncountable|lang=en}} A [[child]]ren's [[game]] in which the players [[pretend]] to be members of a [[household]].
##: {{usex|As the babysitter, Emma always acted as the mother whenever the kids demanded to play '''house'''.|lang=en}}

